import React from 'react'
import logo from './logo.svg'
import './App.css'
import styled from 'styled-components'

const ListContainer = styled.div`
  width: 650px;
  height: 800px;
  background: #e1e6eb;
`
function App() {
  return (
    <div className="App">
       <ListContainer>Options</ListContainer>
    </div>
  )
}

export default App
